import json

def unassigned(data, as_json=False):
    unassigned_ips = []

    if isinstance(data, list):
        for ip_data in data:
            if ip_data['assigned_subusers'] == []:
                unassigned_ips.append(ip_data)
    elif isinstance(data, dict):
        if data['assigned_subusers'] == []:
            unassigned_ips.append(data)

    if as_json:
        return json.dumps(unassigned_ips)
    else:
        return unassigned_ips

